import { Container } from "react-bootstrap";
import "../styles/css/About.css";

const About = () => {
  return (
    <>
      <Container className="about-main">
        <Container className="about-title">
          <h2>About Me.</h2>
        </Container>

        <Container className="about-body">
          <h3>body</h3>
        </Container>
      </Container>
    </>
  );
};
export default About;
